import React from "react";
import {
    Box,
    Icon,
    Button,
    Fab,
    styled,
    TablePagination,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
} from "@mui/material";
import { SimpleCard } from "app/components";
import { useState, useEffect } from "react";
import { Link, Navigate, useParams } from "react-router-dom";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogTitle from "@mui/material/DialogTitle";
import Slide from "@mui/material/Slide";
import { toast } from "react-toastify";
import { getexam } from "app/apis/apiMethods";
import FormControlLabel from "@mui/material/FormControlLabel";
import FormLabel from "@mui/material/FormLabel";
import Radio from "@mui/material/Radio";
import { ErrorMessage } from "formik";
import { InsertEmoticonOutlined } from "@mui/icons-material";


const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
});

const Container = styled("div")(({ theme }) => ({
    margin: "30px",
    [theme.breakpoints.down("sm")]: { margin: "16px" },
    "& .breadcrumb": {
        marginBottom: "30px",
        [theme.breakpoints.down("sm")]: { marginBottom: "16px" },
    },
}));

const StyledTable = styled(Table)(({ theme }) => ({
    whiteSpace: "pre",
    "& thead": {
        "& tr": { "& th": { paddingLeft: 0, paddingRight: 0 } },
    },
    "& tbody": {
        "& tr": { "& td": { paddingLeft: 0, textTransform: "capitalize" } },
    },
}));

const StyledButton = styled(Button)(({ theme }) => ({
    margin: theme.spacing(1),
}));

export default function GetExam() {
    const [state, setState] = useState([]);
    const [page, setPage] = useState(0);
    const [rowsPerPage, setRowsPerPage] = useState(1);
    const [open, setOpen] = React.useState(false);
    const [userID, setUserID] = useState("");

    // const id = localStorage.getItem('id');
    // console.log("id",id)
    const { id } = useParams()
    console.log('id..............')
    // function Users() {
    //     console.log('params');
    //     // 👇️ get ID from url
    //     const {id} = useParams();

    //     console.log(params);}

    function handleClickOpen(id) {
        setOpen(true);
        setUserID(id);
    }
    function handleClose() {
        setOpen(false);
    }

    //    const getexam = async (_id) => {
    //         //const data = _id;
    //         //console.log("bvchdfhcgsdjg")
    //         await getexam(_id).then((res) => {
    //             //console.log("id", _id)

    //             setState(res.data);
    //         }).catch((err)=>{
    //             console.log("qwerty",err)
    //         })
    //     };
    const getExam = async () => {
        console.log("sdfs", id)
        const data = {
            id
        }
        console.log(data, "data.............")
        await getexam(id, data).then((res) => {

            console.log(res, "res............")
            setState(res);
        }).catch((err) => {
            console.log("err", err)
        })
    }

    useEffect(() => {
        getExam();
    }, []);


    const handleChangePage = (_, newPage) => {
        setPage(newPage);
    };

    const handleChangeRowsPerPage = (event) => {
        setRowsPerPage(+event.target.value);
        setPage(0);
    };

    return (
        <Container>
            <Box width="100%" overflow="auto">
                <SimpleCard>
                    <StyledTable>
                        <TableHead>
                            <TableRow>
                                <TableCell align="center" >S.No</TableCell>
                                <TableCell align="center">title</TableCell>
                                <TableCell aligen="center">question</TableCell>
                                {/* <TableCell align="center">Action</TableCell> */}
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {/* {state && state */}
                            {state && Array.isArray(state) && state.length > 0 && state
                                .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                                .map((item, index, question) => {
                                    console.log('item, index', item, index);

                                       return ( <TableRow key={index}>
                                            <TableCell align="center">{index + 1}</TableCell>
                                            <TableCell align="center" variant="contained" color="primary" >
                                                {item.title}
                                            </TableCell>
                                            <TableCell>
                                                   <TableCell>
                                                    {item?.question.map((item) => {
                                                        console.log('item, question', item);
                                                        return (
                                                            <>
                                                                <TableRow key={item._id} >
                                                                    <TableCell align="center"
                                                                    // style={Table}
                                                                     >
                                                                        {item.title}
                                                                        </TableCell>
                                                                    {/* <TableCell align="center"
                                                                    // style={Table}
                                                                     >

                                                                        {item.questionType}

                                                                    </TableCell> */}
                                                                </TableRow>
                                                            </>
                                                        );
                                                    })}
                                                </TableCell>
                                                {item.questionType == 'Radio' && item?.options.map((item, mykey) => {
                                                    return (
                                                        <>
                                                            <TableRow key={mykey}><TableCell align="right" ><input type="radio" id={`coustomradio${index}`} name={`coustomradio${index}`} /> {item.text}</TableCell></TableRow>
                                                        </>
                                                    )
                                                })}
                                                {item.questionType == 'Checkbox' && item?.options.map((item, mykey) => {
                                                    return (
                                                        <>
                                                            <TableRow key={mykey}><TableCell align="right" ><input type="Checkbox" id={`coustomradio${index}`} name={`coustomradio${index}`} /> {item.text}</TableCell></TableRow>
                                                        </>
                                                    )
                                                })}
                                                {item.questionType == 'True/false' && item?.options.map((item, mykey) => {
                                                    return (
                                                        <>
                                                            <TableRow key={mykey}><TableCell align="right" ><input type="radio" id={`coustomradio${index}`} name={`coustomradio${index}`} /> {item.text}</TableCell></TableRow>
                                                        </>
                                                    )
                                                })}
                                            </TableCell>
                                            {/* <TableCell align="center">
                                                <StyledButton variant="contained" color="primary" >
                                                    answer
                                                </StyledButton>
                                            </TableCell> */}
                                        </TableRow>)

                                })}

                            <Dialog
                                open={open}
                                keepMounted
                                onClose={handleClose}
                                TransitionComponent={Transition}
                                aria-labelledby="alert-dialog-slide-title"
                                aria-describedby="alert-dialog-slide-description"
                            ><DialogActions>
                                    <Button onClick={handleClose} color="primary">
                                        <h6>No</h6>
                                    </Button>

                                </DialogActions>
                            </Dialog>
                        </TableBody>
                    </StyledTable>
                </SimpleCard>
                <TablePagination
                    sx={{ px: 2 }}
                    page={page}
                    component="div"
                    rowsPerPage={rowsPerPage}
                    count={state.length}
                    onPageChange={handleChangePage}
                    rowsPerPageOptions={[1, 5]}
                    onRowsPerPageChange={handleChangeRowsPerPage}
                    nextIconButtonProps={{ "aria-label": "Next Page" }}
                    backIconButtonProps={{ "aria-label": "Previous Page" }}
                />
                <TableCell align="center">
                    <StyledButton variant="contained" color="primary" >
                        submit
                    </StyledButton>
                </TableCell>
            </Box>
        </Container>
    );
}
